import React, { Component } from 'react'

export class Categories extends Component {
    constructor(props) {
        super (props)
        this.state = {
            categories: [
                {
                    key: 'all',
                    name: 'Всі'
                },
                {
                    key: 'chairs',
                    name: 'Стільці'
                },
                {
                    key: 'sofa',
                    name: 'Дивани'
                },
                {
                    key: 'tables',
                    name: 'Столи'
                },
                {
                    key: 'light',
                    name: 'Лампи'
                },
                {
                    key: 'anightstand',
                    name: 'Тумби'
                },
                {
                    key: 'rack',
                    name: 'Вішалки'
                },
               
            ]
        }
    }
  render() {
    return (
      <div className='categories'>
        {this.state.categories.map(el => (
           <div key={el.key}>{el.name}</div>
        ))}
      </div>
    )
  }
}

export default Categories
